import { Component } from '@angular/core';
import { ClientesService } from 'servicios/clientServices';

@Component({
  selector: 'app-add-cliente',
  templateUrl: './add-cliente.component.html',
  styleUrls: ['./add-cliente.component.css']
})
export class AddClienteComponent {
  clientes:Cliente[] = [ ];
  clienteName:string = "";
  clientePrice:string = "";
  @ViewChild("it1") myNameElem!: ElementRef;
  @ViewChild("it2") myNameElem2!: ElementRef;


  constructor(private clineteService:ClientesService){}

  public addCliente(){    
    this.clienteService.broadCastClienteName(this.myNameElem.nativeElement.value, 
                                            this.myNameElem2.nativeElement.value);
    this.clienteService.sendClients(this.myNameElem.nativeElement.value,
                                      this.myNameElem2.nativeElement.value);
  }
}
